function drawText() {
  const svg = document.querySelector('svg');
  const maskImage = document.getElementById('mask-image');

  // Create a canvas in the XHTML namespace (offscreen, not added to DOM)
  const canvas = document.createElementNS('http://www.w3.org/1999/xhtml', 'canvas');
  const ctx = canvas.getContext('2d');

  // Set canvas size to match the image
  canvas.width = maskImage.width.baseVal.value;
  canvas.height = maskImage.height.baseVal.value;

  // Create a <g> wrapper for all text elements
  const textGroup = document.createElementNS('http://www.w3.org/2000/svg', 'g');
  svg.appendChild(textGroup);

  // Load the image into an offscreen <canvas>
  const img = new Image();
  img.src = maskImage.href.baseVal;
  img.crossOrigin = "Anonymous"; // Ensure cross-origin compatibility if needed
  img.onload = () => {
    ctx.drawImage(img, 0, 0, canvas.width, canvas.height);

    // Get image data for pixel access
    const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
    const data = imageData.data;

    let x = 50; // Initial x position
    const y = 100; // Constant y position
    const fontSize = 20;
    const fontFamily = 'Arial';
    const text = 'lorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsumlorem ipsum';

    for (let i = 0; i < text.length; i++) {
      const letter = text[i];

      // Check if the pixel at (x, y) is black
      const pixelX = Math.floor(x);
      const pixelY = Math.floor(y);
      const pixelIndex = (pixelY * canvas.width + pixelX) * 4; // RGBA index
      const isBlackPixel =
        data[pixelIndex] === 0 && // Red channel
        data[pixelIndex + 1] === 0 && // Green channel
        data[pixelIndex + 2] === 0; // Blue channel

      if (isBlackPixel) {
        const textElement = document.createElementNS('http://www.w3.org/2000/svg', 'text');
        textElement.setAttribute('x', x);
        textElement.setAttribute('y', y);
        textElement.setAttribute('font-size', fontSize);
        textElement.setAttribute('font-family', fontFamily);
        textElement.textContent = letter;
        textGroup.appendChild(textElement); // Add to the <g> wrapper
      }

      // Create a temporary <text> element to measure its width
      const tempTextElement = document.createElementNS('http://www.w3.org/2000/svg', 'text');
      tempTextElement.setAttribute('font-size', fontSize);
      tempTextElement.setAttribute('font-family', fontFamily);
      tempTextElement.textContent = letter;
      svg.appendChild(tempTextElement);

      // Get the bounding box of the letter to calculate its width
      const bbox = tempTextElement.getBBox();
      x += bbox.width === 0 ? fontSize / 3 : bbox.width; // Advance x position

      svg.removeChild(tempTextElement); // Clean up temporary element
    }
  };
}

document.addEventListener('DOMContentLoaded', drawText);
